import {Link} from 'react-router-dom'
function Contato() {
    return(
        <div>
        <h1> Informações e contatos </h1>
        <Link to="/Sobre">Voltar para sobre</Link>
        <Link to="/Home">Voltar para Home</Link>
        </div>
        )
    }
    
    export default Contato;
